import React, { Component } from 'react'
import {Card, CardContent, Typography} from '@material-ui/core'
import ImgUrl from '../images/sport_systems2.png'

export default class SkiResult  extends Component {
    render() {
        return (
            <React.Fragment>
            <Card style={this.props.cardStyle}>
                <img src={ImgUrl} alt='' style={{width: '250px', height: 'auto'}}/>
                <CardContent>
                    <Typography gutterBottom variant="h5" component="h2">
                    {this.props.skis[this.props.item]}
                    </Typography>
                </CardContent>
            </Card>
            </React.Fragment>
        )
    }
}

